// frontend/src/index.js

import React from 'react';
import { createRoot } from 'react-dom';
import App from './App';
import { BrowserRouter as Router } from 'react-router-dom';
import './styles.css';

const root = document.getElementById('root');

const appRoot = createRoot(root);

appRoot.render(
  <Router>
    <App />
  </Router>
);
